import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'my-app';
}
<!DOCTYPE html>
<html>
<head>
<style>
body {
  margin: 0;
  padding: 0;
}
.logo-container {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
}
.logo {
  width: 200px;
  height: 200px;
}
</style>
</head>
<body>
<div class="logo-container">
<img src="logo.png" alt="Logo" class="logo">
</div>
</body>
</html>
